import React, { useState, useEffect } from 'react';
import axios from 'axios';

function CurrentLog() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/current-logs');
        setData(res.data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch current logs');
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  if (loading) return <div className="text-center mt-8">Loading...</div>;
  if (error) return <div className="text-center mt-8 text-red-500">{error}</div>;

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h2 className="text-2xl font-bold mb-4 text-gray-800">Current Logs</h2>
      <pre className="bg-white p-4 rounded shadow">{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
}

export default CurrentLog;
